import dynamic from "next/dynamic"
import { useState } from 'react'

const Rust = dynamic({
  loader: async () => {
    const rust = await import('../pkg')
    const init = rust.initial_state()

    return (
      (props) => {

        return (
          <>
            <div>{rust.solve(init)}</div>
          </>
        )
      })
  },
})

export default Rust
